import s from './UndefinedUserProfile.module.css';
import user_not_found from '../../../../assets/images/user_not_found.jpeg';
import not_found_text from '../../../../assets/images/not_found_text.png';

export const UndefinedUserProfile = () => {
    return (
        <div className={s.userProfile}>
            <div className={s.userPhoto}>
                <img src={user_not_found} alt='' />
            </div>
            <img src={not_found_text} alt="" />
            <img src={not_found_text} alt="" />
            <img src={not_found_text} alt="" />
            <img src={not_found_text} alt="" />
            <img src={not_found_text} alt="" />
            <img src={not_found_text} alt="" />
        </div>
    );


}
